import React from "react";
import "./ButtonsPanel.css";

function ButtonsPanel(props) {
  return (
    <div className="buttons-panel">
      <button onClick={props.buttonMethod}>Add 1</button>
      <button>Reinit</button>
      <button>Reset</button>
    </div>
  );
}

export default ButtonsPanel;
